import React from "react";
import Log from "./Log";
import { Routes, Route, useLocation } from "react-router-dom";
import Nav from "./Nav";
import Home from "./Home";
import Bgmi from "./Bgmi";
import FF from "./FF";
import Pr from "./Pr";
import Um from "./Um";
import Wit from "./Wit";
import Dep from "./Dep";
import Result from "./Result";
import Bsolo1r from "./Bsolo1r";
import Bsolo2r from "./Bsolo2r";
import Bsquadr from "./Bsquadr";
import Fsolo1r from "./Fsolo1r";
import Fsolo2r from "./Fsolo2r";
import Fsquadr from "./Fsquadr";
import Load from "./Load";
import Help from "./Help";
import Pnf from "./Pnf";
import Fp from "./Fp";
function App() {
  const location = useLocation();
  const rn = location.pathname !== "/";
  const bs1 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "10:00 am",
    w: 100,
    r: 50,
    k: 5,
  };
  const bs2 = {
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "11:00 am",
    w: 100,
    r: 50,
    k: 5,
  };
  const bsd = {
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "12:00 am",
    w: 50,
    r: 25,
    k: 5,
  };
  const fs1 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
    w: 120,
    r: 60,
    k: 10,
  };
  const fs2 = {
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
    w: 120,
    r: 60,
    k: 10,
  };
  const fsd = {
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
    w: 50,
    r: 25,
    k: 10,
  };
  const bs1r = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "10:00 am",
    display: "flex",
  };
  const bs2r = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "11:00 am",
    display: "none",
  };
  const bsdr = {
    name: "BGMI",
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "12:00 am",
    display: "none",
  };
  const fs1r = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "10:00 am",
    display: "none",
  };
  const fs2r = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "11:00 am",
    display: "none",
  };
  const fsdr = {
    name: "FREE FIRE",
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "12:00 am",
    display: "none",
  };
  return (
    <>
      {rn && <Nav />}
      <Routes>
        <Route path="/" element={<Log />}></Route>
        <Route path="/loading" element={<Load />}></Route>
        <Route element={<Pr />}>
          <Route path="/home" element={<Home />}></Route>
          <Route
            path="/bgmi"
            element={<Bgmi bs1={bs1} bs2={bs2} bsd={bsd} />}
          ></Route>
          <Route
            path="/ff"
            element={<FF fs1={fs1} fs2={fs2} fsd={fsd} />}
          ></Route>
          <Route
            path="/um"
            element={
              <Um bs1={bs1} bs2={bs2} bsd={bsd} fs1={fs1} fs2={fs2} fsd={fsd} />
            }
          ></Route>
          <Route
            path="/result"
            element={
              <Result
                bs1={bs1r}
                bs2={bs2r}
                bsd={bsdr}
                fs1={fs1r}
                fs2={fs2r}
                fsd={fsdr}
              />
            }
          ></Route>
          <Route path="/bsolo1r" element={<Bsolo1r bs1={bs1} />}></Route>
          <Route path="/bsolo2r" element={<Bsolo2r bs2={bs2} />}></Route>
          <Route path="/bsquadr" element={<Bsquadr bsd={bsd} />}></Route>
          <Route path="/fsolo1r" element={<Fsolo1r fs1={fs1} />}></Route>
          <Route path="/fsolo2r" element={<Fsolo2r fs2={fs2} />}></Route>
          <Route path="/fsquadr" element={<Fsquadr fsd={fsd} />}></Route>
          <Route path="/deposit" element={<Dep />}></Route>
          <Route path="/withdraw" element={<Wit />}></Route>
          <Route path="/helpline" element={<Help />}></Route>
        </Route>
        <Route path="/fp" element={<Fp />}></Route>
        <Route path="/*" element={<Pnf />}></Route>
      </Routes>
    </>
  );
}
export default App;
